import styles from './MainPage.module.css'
import Header from './Header'
import Table from './Table'
import Modal from './Modal'
import { useState } from 'react'
import { UseSelector, useSelector } from 'react-redux'
import { selectData } from '../State/dataSlice'

function MainPage() {
  const [visibleModal, setVisibleModal] = useState(false)
  const dataInfoProblem = useSelector(selectData)
  return (
    <>
      <div className={visibleModal ? styles.container_none : styles.container}>
        <Header setVisibleModal={setVisibleModal} />
        <Table />
      </div>
      {visibleModal ? <Modal setVisibleModal={setVisibleModal} /> : false}
    </>
  )
}

export default MainPage
